 imply approval for any particular offer or opportunity made on our Websites. Further, See Your Score, LLC does not represent, warrant or guarantee any level of potential savings or other benefit should you choose to apply for a particular offer. Any suggestion or representation of possible savings are for illustrative purposes only and may vary based on your individual financial circumstances and the terms made available to you by the applicable issuer or lender. See Your Score, LLC disclaims all liability for any errors or omissions in any express or implied suggestions or representations related to possible savings made by See Your Score, LLC or its marketing partners. For complete information on any particular offer, see the terms and conditions on the issuer or lender&#39;s website. Once you click apply for any offers, you will be directed to the issuer or lender&#39;s website where you may review the terms and conditions of the applicable opportunity or offer before applying.</span></p><p class="c13"><span class="c2 c0">While See Your Score, LLC uses reasonable efforts to present the most accurate information, we show a summary to help you choose a third party service, not the full legal terms. See Your Score, LLC does not control or endorse such websites and is not responsible for their content, nor is it responsible for the accuracy or reliability of any information, data, opinions, offers, advice, or statements contained within such websites, nor can See Your Score, LLC guarantee your eligibility to take advantage of any of the information, data, opinions, offers, advice or statements contained within those websites. Please carefully read the terms and conditions or terms of use policies of any other third party company or website you may link to from our Websites. If you decide to access any of the third party sites linked to the Websites, you do so at your own risk. See Your Score, LLC reserves the right to terminate any link or linking program at any time. See Your Score, LLC disclaims all warranties, express and implied, as to the accuracy, validity, and legality or otherwise of any materials or information contained on such third party websites.</span></p><p class="c13"><span class="c11 c0 c10 c6 c8">Authentication</span></p><p class="c13"><span>See Your Score, LLC will use commercially reasonable efforts to provide Services to you in a timely manner, including instant online delivery of your credit report for online customers when available. For certain online Services, however, when the system is unable to authenticate you, you may be routed through an alternate authentication process, such as authentication through Customer Care or a manual authentication process. In the event See Your Score, LLC utilizes a manual authentication process, See Your Score, LLC will send a private access code via U.S. mail to the address in your credit file, which you can use to access your account online. This process is normally completed within five (5) to seven (7) days. In the event that you are routed through an authentication process, it is your responsibility to successfully complete authentication so that you can gain access to your account on the Website. Your account, including any membership or enrollment in a Service, will continue, including, if applicable, continuing to monitor your credit report(s) or score(s), all of which will be available to you once you complete authentication. Consequently, for any ongoing paid Services, you will continue to be billed for your membership and the associated services available to you until you cancel in accordance with this Agreement. Please note that, for most Services, See Your Score, LLC cannot offer a manual authentication process and will be unable to fulfill your order if you fail online authentication one or more times. In the event you fail online authentication one or more times, you may be directed to Customer Care to complete the authentication process over the telephone.</span></p><p class="c13 c5"><span class="c11 c0 c10 c6 c8"></span></p><p class="c13"><span class="c6 c8">FICO</span><span class="c6 c8">&reg;</span><span class="c11 c0 c10 c6 c8">&nbsp;Scores</span></p><p class="c13"><span>FICO</span><span>&reg;</span><span class="c2 c0">&nbsp;Scores are developed by Fair Isaac Corporation. The FICO Score provided by See Your Score, LLC in Experian Credit Works and Experian Credit Tracker is based on FICO Score 8, and is powered by Experian Credit Bureau credit data. See Your Score, LLC may, in its discretion and from time to time, provide a FICO Score based on the FICO Score 8 scoring model at no charge to you in a free Service (such as Experian Credit Basics). In the event See Your Score, LLC provides a FICO Score at no charge to you, such free FICO Score will not include an explanation of the positive and negative factors impacting your score. This information is included in a paid Service (such as Experian Credit Works or Experian Credit Tracker) that includes a FICO Score. Many but not all lenders use FICO Score 8.</span></p><p class="c13"><span>In addition to the FICO Score 8, See Your Score, LLC may offer and provide other base or industry-specific FICO Scores (such as FICO Auto Scores and FICO Bankcard Scores). The other FICO Scores made available are calculated from versions of the base and industry-specific FICO Score models. There are many different credit scoring models that can give a different assessment of your credit rating and relative risk (risk of default) for the same credit report. Your lender or insurer may use a different FICO Score than FICO Score 8 or such other base or industry-specific FICO Score, or another type of credit score altogether. Just remember that your credit rating is often the same even if the number is not. For some consumers, however, the credit rating of FICO Score 8 (or other FICO Score) could vary from the score used by your lender. The statements that &quot;90% of top lenders use FICO Scores&quot; and &quot;FICO Scores are used in 90% of credit decisions&quot; are based on a third-party study of all versions of FICO Scores sold to lenders, including but not limited to scores based on FICO Score 8. Base FICO</span><span>&reg;</span><span>&nbsp;Scores (including the FICO Score 8) range from 300 to 850. Industry-specific FICO Scores range from 250-900. Higher scores represent a greater likelihood that you&#39;ll pay back your debts so you are viewed as being a lower credit risk to lenders. A lower FICO Score indicates to lenders that you may be a higher credit risk. There are three different major credit reporting agencies &mdash; Experian Credit Bureau, TransUnion</span><span>&reg;</span><span>&nbsp;and Equifax</span><span>&reg;</span><span class="c2 c0">&nbsp;&mdash; that maintain a record of your credit history known as your credit report. Your FICO Score is based on the information in your credit report at the time it is requested. Your credit report information can vary from agency to agency because some lenders report your credit history to only one or two of the agencies. So your FICO Score can vary if the information they have on file for you is different. Since the information in your report can change over time, your FICO Score may also change.</span></p><p class="c13"><span>Due to how FICO</span><span>&reg;</span><span class="c2 c0">&nbsp;Scores are calculated, it is possible that you may experience a change in your score, including as compared to other scoring models previously provided by See Your Score, LLC (including as part of your Experian Credit Tracker membership).</span></p><p class="c13"><span>Under certain circumstances, we will be unable to provide a credit score to you based on your particular credit behaviors, or a score may be unavailable at a particular time. Although your score may be unavailable at a given time, it may later become available, depending on a change in your credit behaviors or to the information a credit reporting agency has on file for you. Scores may be offered to you free of charge, or in some circumstances, may require a fee. Even if you pay a fee to obtain a score, a score may not always be available to you (even if a credit report is available to you). If a credit score is unavailable, you may want to learn more about the reasons a score is not available for you, and what actions you might be able to take so later a score may be generated for you. In the event a score is not available for you and you have questions, please email </span><span class="c8"><a class="c20" href="mailto:contact@seeyourscore.com">contact@seeyourscore.com</a></span><span class="c2 c0">.</span></p><p class="c17"><span class="c6 c8">Not a credit repair organization or contract</span></p><p class="c13"><span>See Your Score, LLC offers access to your credit report, FICO</span><span>&reg;</span><span class="c2 c0">&nbsp;Score, and other credit information. See Your Score, LLC is not a credit repair organization, and is not offering to sell, provide or perform any service to you for the express or implied purpose of either improving your credit record, credit history or credit rating or providing advice or assistance to you with regard to improving your credit record, credit history or credit rating. You acknowledge and agree that you are not seeking to purchase, use, or access any of the Service and Websites (or any content in the Websites) in order to do so.</span></p><p class="c13"><span class="c2 c0">Accurate adverse information on your credit report cannot be changed. If you believe that your credit report contains inaccurate, non-fraudulent information, it is your responsibility to contact the relevant credit reporting company, and follow the appropriate procedures for notifying the credit reporting company that you believe that your credit report contains an inaccuracy. Any information provided to you regarding the procedures followed by the various credit reporting companies related to the removal of inaccurate, non-fraudulent information is provided without charge to you and is available for free. Any such information is not included as part of your credit score monitoring product but is provided free of charge to all consumers, regardless of whether they are Customers of the credit score monitoring product.</span></p><p class="c9 c5"><span class="c2 c0"></span></p><p class="c9"><span class="c0 c6">4. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span class="c0 c6 c8">Updates</span><span class="c0 c6">.</span><span class="c0">&nbsp; </span><span class="c6">SEE YOUR SCORE</span><span class="c0 c6">, LLC RESERVES THE RIGHT TO AMEND THE WEBSITE AND THE TERMS OF THIS AGREEMENT IN ITS DISCRETION FROM TIME TO TIME. &nbsp;YOU ARE RESPONSIBLE FOR MONITORING SUCH SITES. &nbsp;</span><span>See Your Score</span><span class="c2 c0">, LLC may, but is not obligated to, offer upgrades, updates, and improvements to the Website and Services, and to add or discontinue any Services. &nbsp;</span></p><p class="c9 c5"><span class="c0 c10 c6 c8 c11"></span></p><p class="c9"><span class="c0 c6">5.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span class="c0 c6 c8">Limited License</span><span class="c0 c6">. </span><span>See Your Score</span><span class="c0">, LLC hereby grants to you during the Term (as defined below) of this Agreement a non-exclusive, non-assignable, non-transferable, non-sublicensable, limited license (&ldquo;</span><span class="c0 c8">License</span><span class="c0">&rdquo;) to use the Website and the Services for your business planning purposes (&ldquo;</span><span class="c0 c8">Purpose</span><span class="c0">&rdquo;). You shall display all notices for trademarks, service marks, trade dress, patents, patents pending, and other intellectual property (the &ldquo;</span><span class="c0 c8">Intellectual Property</span><span class="c0">&rdquo;) that we require. &nbsp;You shall not copy or reverse engineer, in whole in or pa