 set forth in Federal Rule of Civil Procedure 11(b), then the payment of all such fees will be governed by the AAA Rules. In such case, you agree to reimburse See Your Score, LLC for all monies previously disbursed by it that are otherwise your obligation to pay under the AAA Rules.</span></p><p class="c13"><span class="c2 c0">(d) The arbitrator may make rulings and resolve disputes as to the payment and reimbursement of fees and expenses at any time during the proceeding or in the final award, pursuant to applicable law and the AAA Rules.</span></p><p class="c13"><span class="c2 c0">(e) Discovery and/or the exchange of non-privileged information relevant to the dispute will be governed by the AAA Rules.</span></p><p class="c13"><span class="c2 c0">(f) YOU AND SEE YOUR SCORE, LLC AGREE THAT EACH MAY BRING CLAIMS AGAINST THE OTHER ONLY IN YOUR OR ITS INDIVIDUAL CAPACITY, AND NOT AS A PLAINTIFF OR CLASS MEMBER IN ANY PURPORTED CLASS OR REPRESENTATIVE PROCEEDING. Further, unless both you and See Your Score, LLC agree otherwise, the arbitrator may not consolidate more than one person&#39;s claims, and may not otherwise preside over any form of a representative or class proceeding. The arbitrator may award injunctive relief only in favor of the individual party seeking relief and only to the extent necessary to provide relief warranted by that party&#39;s individual claim. If this specific subparagraph (f) is found to be unenforceable in its entirety, then the entirety of this arbitration provision shall be null and void.</span></p><p class="c13"><span>(g) Notwithstanding any provision in this Agreement to the contrary, we agree that if See Your Score, LLC makes any change to this arbitration provision (other than a change to the Notice Address) during your membership in any Service, including credit monitoring, or subsequent to your purchase of any Service, you may reject any such change and require See Your Score, LLC to adhere to the language in this provision as written at the time of your enrollment or purchase if a dispute between us arises regarding such Service.</span></p><p class="c4 c5"><span class="c2 c0"></span></p><p class="c4"><span class="c1 c0">18.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span class="c0 c10 c6 c8">Complete Agreement</span><span class="c1 c0">. &nbsp;</span><span class="c2 c0">This Agreement contains the entire agreement of the parties and supersedes any and all other agreements, whether oral or in writing, between the parties concerning the subject matter hereof. &nbsp;Any modification of this Agreement shall be effective only if in a writing signed by the parties.</span></p><p class="c4 c5"><span class="c3 c0"></span></p><p class="c9"><span class="c1 c0">19.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span class="c0 c10 c6 c8">Severability</span><span class="c1 c0">.</span><span class="c7 c0">&nbsp; If any provision of this Agreement is held by a court or tribunal of competent jurisdiction to be invalid, void, or unenforceable, the remaining provisions shall nevertheless continue in full force and effect without being impaired or invalidated in any way. &nbsp;</span></p><p class="c4 c5"><span class="c3 c0"></span></p><p class="c4"><span class="c1 c0">20.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span class="c0 c10 c6 c8">Assignment</span><span class="c1 c0">.</span><span class="c7 c0">&nbsp; You shall not assign or sublicense any part of this Agreement, in whole or in part, without the prior written consent of </span><span>See Your Score</span><span class="c7 c0">, LLC. &nbsp;</span></p></div>
